  return (
    <>
      <NavBar />

      <section className="hero-section">
        <h1>GameShop</h1>
        <p> Find every you want</p>
      </section>
      <section className="new-arrivals">
        <h2>New Arrivals</h2>
      </section>
    </>
  );
};

export default Home;
